window.bookSummaryJSON = "<p>We’ve finally uncovered the depths of Jakub’s plan, but that discovery came with consequences none of us expected.</p> <p>Despite his wolf’s growls in my direction, Kaillen’s determined to prove his love. So the two of us delve into my family’s long buried past to discover the truth of who I really am. But things don’t go as planned, and our struggles uncover an impossible choice. I can either stay on earth and accept that my hunter and I will never be mated, or I can embrace my destiny and say goodbye to the only man I’ve ever loved.</p>"; 
